import React from "react";
import "../../../Styles/Pages/About/AboutFourth.scss";

function AboutFourth() {
  return (
    <div className='aboutFourth'>
      <div className='aboutFourth__left'>
        <h1>Do more with connected payments</h1>
        <p>
          The old transaction journey was complex. It wasn’t built for agile,
          global business. We’ve changed that. We make payments seamless – but
          we also make them so much more. Using our expertise, we empower you to
          unlock more value in every transaction. So you can do what you do even
          better.
        </p>
      </div>
      <div className='aboutFourth__right'></div>
    </div>
  );
}

export default AboutFourth;
